import React, { useRef } from 'react'
import '../App.css'

const Home = () => {
  const luckyName = useRef(null)

  const SubmitForm = e => {
    e.preventdefault()
    console.log(luckyName)
  }

  return (
    <div className='App'>
      <h1>Home</h1>
      <form action='' onSubmit={SubmitForm}>
        <div style={{ display: 'grid' }}>
          <label
            style={{
              fontSize: '2rem',
              fontFamily: 'monospace',
              padding: '12px'
            }}
            htmlFor='luckyName'
          >
            Enter your luckyName
          </label>
          <input
            style={{ height: '39px', width: '376px', marginLeft: '706px' }}
            type='text'
            id='luckyName'
            ref={luckyName}
          />
        </div>
        <button>Submit</button>
      </form>
    </div>
  )
}

export default Home
